      <div className="side-nav">
        <ul>
          <li>
            <Link to="#" className="a">
              Form
            </Link>
          </li>
          <li>
            <Link to="#" className="a">
              Table
            </Link>
          </li>
        </ul>
      </div>
    </div>
  );
}

export default Sidebar;
